import React from 'react';

import { withFirebase } from '../Firebase'
function signOut() {
    return firebase.doSignOut
}

const SignOutButton = ({firebase}) => (
  <button type="button" onClick={signOut({firebase})}>
    Sign Out
  </button>
)

export default withFirebase(SignOutButton)
